import os, sys
import subprocess
import winreg as reg
import ctypes


logo_hex = """

"""

icon_hex = """

"""

# Convert hexadecimal data to bytes
logo_binary_data = bytes.fromhex(logo_hex)
icon_binary_data = bytes.fromhex(icon_hex)

logopath = os.path.join(os.environ['TEMP'], 'logo.bmp')
iconpath = os.path.join(os.environ['TEMP'], 'hric.ico')

# Save the binary data as a BMP image
with open(logopath, "wb") as bmp_file:
    bmp_file.write(logo_binary_data)

# save the binary data as ico image
with open(iconpath, "wb") as ico_file:
    ico_file.write(icon_binary_data)

# Set the Logo value in HKLM\SOFTWARE\Microsoft\Windows\CurrentVersion\OEMInformation
subprocess.run(['reg', 'add', 'HKLM\\SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\OEMInformation', 
                '/v', 'Logo', '/t', 'REG_SZ', '/d', logopath, '/f'], check=True)

# Set the MaxDisplay value in HKCU\SOFTWARE\Microsoft\Windows\CurrentVersion\Explorer\RecentDocs\.bmp
subprocess.run(['reg', 'add', 'HKCU\\SOFTWARE\\Microsoft\\Windows\\CurrentVersion\\Explorer\\RecentDocs\\.bmp', 
                '/v', 'MaxDisplay', '/t', 'REG_DWORD', '/d', '0', '/f'], check=True)

# Define your custom command and label
custom_command = "chrome https://rooyca.github.io/portfolio/es/index.html#contact"
custom_label = "Solicitar Ayuda"

# Function to add the custom context menu entry
def add_custom_context_menu_entry(key: str):
    try:
        # Add the context menu entry using the reg add command
        command = [
            'reg', 'add',
            f'HKEY_CLASSES_ROOT\\{key}\\shell\\{custom_label}',
            '/ve', '/t', 'REG_SZ',
            '/d', custom_label, '/f'
        ]
        subprocess.run(command, check=True)

        # Set the command to execute
        command = [
            'reg', 'add',
            f'HKEY_CLASSES_ROOT\\{key}\\shell\\{custom_label}\\command',
            '/ve', '/t', 'REG_SZ',
            '/d', custom_command, '/f'
        ]
        subprocess.run(command, check=True)

        # Set the icon path
        command = [
            'reg', 'add',
            f'HKEY_CLASSES_ROOT\\{key}\\shell\\{custom_label}',
            '/v', 'Icon', '/t', 'REG_SZ',
            '/d', iconpath, '/f'
        ]
        subprocess.run(command, check=True)

        print(f"Custom context menu entry added: {custom_label}")

    except subprocess.CalledProcessError as e:
        print(f"Error: {e}")
        sys.exit(1)


if __name__ == "__main__":
    # Check for administrative privileges
    if not ctypes.windll.shell32.IsUserAnAdmin():
        print("Please run this script as an administrator.")
        sys.exit(1)

    # Add the custom context menu entry
    add_custom_context_menu_entry("*")
    add_custom_context_menu_entry("Directory\\Background")